void way(int j,int n,int *num,int *box,int *dist, int *p, int *fp,int count,double *first){
	int  i, k, flag, m;
	double t;
	if(count < n){
		for(i = (j + 1) % n;i != j;i = (i + 1) % n){
			flag = 0;
			for(k = 0;k < count;k++){
				if(*(num + i) == *(p + k))
					flag = 1;
			}
			if(flag == 0){
				*(p + count) = *(num + i);
				count++;
				way(i,n,num,box,dist,p,fp,count,first);
				count--;
				*(p + count) = 0;
			}
		}
	}
	if(count == n){
		t = 0;
		m = 0;
		for(i = 0;i < n - 1;i++){
			for(j = 0;*(p + i) != *(num + j);j++);
			for(k = 0;*(p + i + 1) != *(num + k);k++);
			m += *(box + j);
			t += minute(*(dist + j),*(dist + k),m * 20);
		}
		if(*first == 0){
			*first = t;
			for(i = 0;i < n;i++)
				*(fp + i) = *(p + i);
		}
		else if(*first > t){
			*first = t;
			for(i = 0;i < n;i++)
				*(fp + i) = *(p + i);
		}
	}
}
